import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        width: '80%',
        overflow:'scroll',
    },
});

function createData(Entreprise, Exposition, Secteur) {
    return { Entreprise, Exposition, Secteur };
}

const rows = [
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
];

export default function CountrepartieTable() {
    const classes = useStyles();

    return (
        <TableContainer component={Paper}>
            <Table className={classes.table} size="small" aria-label="a dense table">
                <TableHead>
                    <TableRow>
                        <TableCell>Entreprise</TableCell>
                        <TableCell align="right">Exposition</TableCell>
                        <TableCell align="right">Secteur activité</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <TableRow key={row.name}>
                            <TableCell component="th" scope="row">
                                {row.Entreprise}
                            </TableCell>
                            <TableCell align="right">{row.Exposition}</TableCell>
                            <TableCell align="right">{row.Secteur}</TableCell>

                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
}
